import React from 'react'
import { Navigate } from 'react-router-dom'
import './sel.css'

function Selection() {
    function customer(){
        alert('login form')
    }
    function washer(){
        alert('login link')
    }

    return (
        <div>
            <h1>Login</h1>
            <div  className='user'>
               
                <button onClick={()=>{
                    Navigate('/sign-up')

                }}><h1> Customer</h1></button>
                <h6 >Create your Account </h6>
            </div>
            <div className='wash'>
            
                <button onClick={washer} > <h1> Washer</h1></button>
                <h5>Create your account<a href='/sign-up'>Signup</a></h5>

            </div>
        </div>
    )
}

export default Selection
